import React from 'react';
import './navbar.css';

const navbar = (props) => {
    return (
        <div className="navbar">
            <div className="Logo">
                <h1>Farane Javadi</h1><h3> / FRONT END DEVELOPER</h3>
            </div>
            <div className="navLinks">
                <ul>
                    <li>ABOUT ME</li>
                    <li>RESUME</li>
                    <li>PROJECTS</li>
                    <li>CONTACT</li>
                </ul>
            </div>
        </div>
     );
}

export default navbar;
